    TC-88-03",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-01-16T06:27:22.209615",nt"name":
    "larval-fish-identification-from-cruises-at-oahu-tc-88-03",nt"isopen": false,nt"url":
    null,nt"notes": "One cruise aboard the NOAA ship Townsend Cromwell was conducted
    during 14 April-3 May 1988. Collectors included George Boehlert, Bruce Mundy, Ronald
    Yoshimoto, Keith Bigelow, Donald Kobayashi, Dennis Therry, and James Uchiyama.  Plankton
    and midwater trawl samples were taken in the vicinity of O`ahu.  Larvae were sampled
    with a 1 m2 multiple opening-closing net and environmental sensing system (MOCNESS)
    in a depth stratum of 25-45 m along continuous transects to investigate onshore-offshore
    distributions of fish larvae. Nets were constructed of 0.333 mm Nitex mesh. Estimates
    of water volumes filtered were based on mechanical flowmeter readings. MOCNESS hauls
    were 12 minutes duration for each net, fished in a stepped oblique fashion with
    mean tow speeds of approximately 75 cm/sec; the tow speed was adjusted to maintain
    a net mouth angle near 45".  Fish larvae in the hyponeuston were collected with
    a 0.49 m2 Manta net modified to take surface samples to a depth of 0.7 m.  Juvenile
    fish were sampled in the upper 200 m with a 100 m2 mouth-opening OSU Midwater rope
    trawl and in the upper 100 m with a 1.8 m mouth-width Isaacs-Kidd midwater trawl.
     All samples were sorted and total numbers of larvae are available, but larvae
    from only three of the samples have been identified (by Bruce C. Mundy).",nt"license_title":
